import Header from './Frontpage/Header';
import DesignsLayover from './Frontpage/DesignsLayover';
import Content3 from './Frontpage/Content3';
import Footer from './Frontpage/Footer';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Admin from './Frontpage/Admin';
import AdminDisplay from './Frontpage/AdminDisplay';

function App() {
  return (
    <Router>
    <div>
      <Header/>
      <Routes>
      <Route path="/" element={<Home/>}></Route>
      <Route path="/admin" element={<Admin/>}></Route>
      <Route path="/admindisplay" Component={AdminDisplay}></Route>
      </Routes>
    </div>
    </Router>
  );
}
const Home = () => (
  <div>
    <DesignsLayover />
    <Content3 />
    <Footer/>
  </div>
);

export default App;
